import 'package:tracenac/core/utils/app_url.dart';import 'package:tracenac/features/menu/data/menu_model/menu_model_class.dart';import 'package:tracenac/features/menu/data/repository/menu_repository.dart';import '../../../../core/services/network/network_api_services.dart';class MenuHttpApiRepository implements MenuRepository{  @override  Future<GetMenuModelClass> menuApi() async {    final _api = NetworkApiServices();    final response = await _api.getApi(AppUrl.getMenu);    print("Get Menu response==> $response");    return GetMenuModelClass.fromJson(response);  }}